import { useState } from 'react';
import './useContext.css';
import Page from '../components/useContext/Page';

export default function UseContext() {
  const [isDark, setIsDark] = useState(false);

  return (
    <>
      <Page isDark={isDark} setIsDark={setIsDark} />
    </>
  );
}
